"use strict";

const TP = require("../src/index.js");

const pluginId = "TPDiscord";

const client = new TP.Client();
client.on("Message",  (data) => {
  console.log("Message:" + JSON.stringify(data));
});
client.on("Info", (data) => {
  console.log("Info:" + data);
});

client.connect({ pluginId });
